// src/components/AddMaster.js
import React from 'react';
import { useAuth } from '../context/AuthContext';

const AddMaster = () => {
  const { isAuthenticated } = useAuth();

  return (
    <div>
      {isAuthenticated ? (
        <div>
          <h2>Add Master</h2>
          <form>
            {/* form fields here */}
          </form>
        </div>
      ) : (
        <p>Please log in to add a master.</p>
      )}
    </div>
  );
};

export default AddMaster;
